import React from 'react';

function Project({ project }) {
  return (
    <div style={{ marginLeft: "10px", marginBottom: "10px", color: '#000000' }}>
      <img src={project.imageUrl} alt={project.title} />
      <h3>{project.title}</h3>
      <p>{project.description}</p>
      <a href={project.projectUrl} target="_blank" rel="noopener noreferrer" style={{ color: '#ffffff', fontSize: '14px', textDecoration: 'none', backgroundColor: '#6c757d', padding: '8px', borderRadius: '5px' }}>View Project</a>
    </div>
  );
}

export default Project;
